import React from "react";

//import reactstrap
import {
  Card,
  CardBody,
  FormGroup,
  Input,
  Container,
  Row,
  Col,
  Button,
  Form,
  CardFooter,
} from "reactstrap";

// core components
import SimpleHeader from "components/Headers/SimpleHeader.js";

import { ToastContainer, toast } from "react-toastify";
import TextArea from "antd/lib/input/TextArea";

function FAQ() {
  return (
    <>
      <SimpleHeader name="FAQ" />
      <ToastContainer
        position="bottom-right"
        autoClose={5000}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
        theme="colored"
      />
      <Container className="mt--6">
        <Card>
          <Form>
            <CardBody>
              <Row>
                <Col md="4" lg="12">
                  <label
                    className="form-control-label"
                    htmlFor="example4cols2Input"
                  >
                    Questions
                  </label>
                  <Input
                    id="example4cols2Input"
                    placeholder="Questions"
                    type="text"
                    // onChange={handleChange("firstname")}
                    // value={studentData.firstname}
                    required
                  />
                </Col>
              </Row>
              <Row className="mt-4">
                <Col md="4" lg="12">
                  <label
                    className="form-control-label"
                    htmlFor="example4cols2Input"
                  >
                    Answers
                  </label>
                  <TextArea type="text" placeholder="Answers" />
                </Col>
              </Row>
            </CardBody>
          </Form>
        </Card>
      </Container>
    </>
  );
}

export default FAQ;
